B.XV=new A.a5("Es basiert auf dem Prinzip, dass Menschen h\xe4ufiger zu einem Spiel zur\xfcckkehren, wenn sie unvorhersehbare Belohnungen erhalten. Jedes Mal, wenn man das Rad dreht, k\xf6nnte man eine kleine oder gro\xdfe Belohnung bekommen \u2013 oder manchmal gar nichts. Das macht das Ganze besonders spannend, weil man nie wei\xdf, was als N\xe4chstes kommt.\n Hast du bemerkt, dass du \xf6fter das Spiel \xf6ffnest, nur um das Gl\xfccksrad zu drehen? F\xfchlst du dich motiviert, es immer wieder zu versuchen, in der Hoffnung, eine gr\xf6\xdfere Belohnung zu bekommen? Genau das ist die Absicht der Spieleentwickler: Sie wollen, dass du l\xe4nger im Spiel bleibst und vielleicht sogar echtes Geld ausgibst, um weitere Chancen auf Belohnungen zu bekommen.",null,null,null,null,null,null,null,null)
B.XW=new A.a5("Die Sammlungen sind so gestaltet, dass du das Bed\xfcrfnis versp\xfcrst, jedes einzelne Item zu erwerben, um die vollst\xe4ndige Belohnung zu erhalten. Oft fehlt dir am Ende nur noch ein kleines Teil, und das Spiel bietet dir gezielt die M\xf6glichkeit, dieses fehlende Item entweder durch stundenlanges Spielen oder gegen echtes Geld zu bekommen. Hast du bemerkt, wie zufriedenstellend es ist, eine Sammlung abzuschlie\xdfen? Oder dass du immer wieder spielst oder sogar Geld ausgibst, nur um das letzte Teil zu erhalten? Das ist genau so beabsichtigt: Spieleentwickler wollen, dass du dich motiviert f\xfchlst, diese letzte L\xfccke zu f\xfcllen, indem du mehr Zeit im Spiel verbringst oder Geld investierst, um das Gef\xfchl der Vollst\xe4ndigkeit zu erreichen.",null,null,null,null,null,null,null,null)
